Description. Male: Cephalothorax dark brown to black with scattered pennate white hairs ( Figs 17, 18 ). Surrounds of ALE, PME and PLE, similar colour. Clypeus narrow (
Fig. 20
), with a thin fringe of dark hairs. Chelicerae geniculate, dark brown with two small promarginal teeth and a small, unident retromarginal tooth. Endites (
Fig. 19
) medium brown grading to yellow distally. Labium and sternum medium brown. Dorsal abdomen (
Fig. 17
) dark brown to black with a variable pattern of bright yellow lateral stripes and patches. Spinnerets dark brown. Ventral abdomen black with two longitudinal rows of small yellow dots. Posterior dorsal bands fold around onto the ventral surface (
Fig. 18
) towards the rear and appear as two bright yellow areas. L 1 entirely dark brown and remaining legs yellow with dark brown femora. L 1 more robust and without fringing. L 4 longest. Palp (
Figs 25–27
): dark brown, cymbium with lighter tip. Tibia short with apophysis tapering to a point whilst curving inwards along its length. Tegulum rounded, bulging somewhat, with a medium sized posterior lobe. The sperm duct forms a half circle along the distal and anterior edge of the tegulum. The short embolus tapers from a broad base on the distal edge of the tegulum. Dimensions: CL 2.91 , EFL 0.99 , CW 2.04 , AEW 1.67 , AMEW 1.11 , PEW 1.67 , AL 2.97 , P 1 +T 1 2.48 , L 1 5.57 ( 1.67 + 1.05 + 1.30 + 1.87 + 0.68 ), L 2 4.52 ( 1.42 + 0.93 + 0.93 + 0.68 + 0.56 ), L 3 4.52 ( 1.36 + 0.80 + 0.87 + 0.93 + 0.56 ), L 4 5.88 ( 1.73 + 0.93 + 1.42 + 1.24 + 0.56 ).
